import TopNav from "../../topNav/js/topNav.js";
import "../css/home.css";
export default function HomePage() {
  return (
    <div className="container">
      <div className="home-page-main-container">
        <TopNav pageNumber={0} />
        <div className="middle-part-home-page-main-container">
          <div></div>
        </div>
      </div>
    </div>
  );
}
